import { Route, Routes } from "react-router-dom";
import { LoginPage, Dashboard } from "./Imports/Index";
import "./App.css";
function App() {
  return (
    <Routes>
      <Route path="/" element={<LoginPage />} />
      <Route path="/dashboard" element={<Dashboard />} />
    </Routes>
  );
}

export default App;
